/** @format */

import React from "react";

class Navbar extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <input placeholder="Search a repository"></input>
        <button>Submit</button>
      </div>
    );
  }
}

export default Navbar;
